<html lang="id">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Chat Screenshot</title>
<style>
  * { margin: 0; padding: 0; box-sizing: border-box; }
  body {
    background: #111;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    min-height: 100vh;
    font-family: sans-serif;
    padding: 20px;
    gap: 30px;
  }
  .chat-img {
    max-width: 420px;
    width: 100%;
    border-radius: 16px;
    box-shadow: 0 8px 40px rgba(0,0,0,0.6);
  }
  #goblokBtn {
    background: linear-gradient(135deg, #ff4444, #cc0000);
    color: white;
    border: none;
    border-radius: 50px;
    padding: 18px 48px;
    font-size: 1.6rem;
    font-weight: 900;
    letter-spacing: 2px;
    cursor: pointer;
    box-shadow: 0 0 30px rgba(255,50,50,0.5);
    text-transform: uppercase;
    transition: transform 0.1s, box-shadow 0.1s;
  }
  #goblokBtn:hover {
    transform: scale(1.05);
    box-shadow: 0 0 50px rgba(255,50,50,0.8);
  }
  #goblokBtn:active { transform: scale(0.95); }
  #goblokBtn.shake { animation: shake 0.5s ease; }
  @keyframes shake {
    0%,100% { transform: translateX(0); }
    20% { transform: translateX(-10px) rotate(-3deg); }
    40% { transform: translateX(10px) rotate(3deg); }
    60% { transform: translateX(-7px) rotate(-2deg); }
    80% { transform: translateX(7px) rotate(2deg); }
  }
</style>
